import React from 'react';
import Header from './Header';
import Footer from './Footer';
import Note from './Note';

function Card(){
	return <div> 
		<h2> Beyounce </h2> 
	</div>
}
function App(){
	return <div>
	<Header /> 
	<Note />
	<Card />
	<Footer />
	</div>
}

export default App;
